import React from 'react';
import '../../App.css';
import './Pages.css';
import one from './1.png';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
/* import CrimeComparison from '../CrimeComparison';
import AverageCrimeTrend from '../AverageCrimeTrend'; */

const useStyles = makeStyles((theme) => ({
    root: {
      maxWidth: 900,
    },
    media: {
      height: 0,
      paddingTop: '56.25%', // 16:9
    },
  }));

export default function CrimeCategorization() {

    const classes = useStyles();
    
    return (
        <Grid
            container
            spacing={0}
            direction="column"
            alignItems="center"
            justify="center"
            style={{ minHeight: '100vh' }}
        >
            <Grid><Typography><h1>Crime Categorization</h1></Typography></Grid>
            <Grid>
            <Card className = {classes.root}>
            <CardMedia
                className={classes.media}
                image={one}
                title="Paella dish"
            />
            <CardContent>
            <Typography variant="body2" color="textSecondary" component="p">
                As seen above, this page displays the types of crimes shown as a trend over time. The graph can be altered depending on the information a user 
            </Typography>
            </CardContent>
            </Card>
            </Grid>
        </Grid>
        /*{<CrimeComparison />
            <AverageCrimeTrend />*/
    );
}
